INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 120701, 1, 0, 0, 0, 120701, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 4, 0, "シェフィ（ニューイヤー）", "2025/01/20 11:59:59", 0, 0, 1, 120701, 22, 120701, 3, 1.84, 283, "しぇふぃ", "2025/01/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 120801, 2, 0, 0, 0, 120801, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 4, 0, "ルカ（ニューイヤー）", "2030/12/31 15:00:00", 0, 0, 1, 120801, 22, 120801, 1, 1.3, 193, "るか", "2023/10/16 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 120901, 12, 0, 0, 0, 120901, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 3, 0, "イリヤ（ニューイヤー）", "2025/01/20 11:59:59", 0, 0, 2, 120901, 38, 120901, 3, 1.425, 424, "いりや", "2025/01/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 121001, 1, 0, 0, 0, 121001, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 5, 0, "ペコリーヌ（オーバーロード）", "2024/02/29 11:59:59", 0, 0, 1, 121001, 41, 121001, 3, 2.25, 164, "ぺこりーぬ", "2024/02/22 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 121101, 1, 0, 0, 0, 121101, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 7, 0, "キャル（オーバーロード）", "2024/02/29 11:59:59", 0, 0, 2, 121101, 42, 121101, 3, 2.07, 588, "きゃる", "2024/02/22 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 121201, 6, 0, 0, 0, 121201, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 4, 0, "ラビリスタ（オーバーロード）", "2030/12/31 15:00:00", 0, 0, 1, 121201, 40, 121201, 1, 1.55, 260, "らびりすた", "2023/11/16 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 121301, 3, 0, 0, 0, 121301, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 3, 0, "クルミ（ステージ）", "2030/12/31 15:00:00", 0, 0, 1, 121301, 3, 121301, 3, 1.9, 731, "くるみ", "2022/03/03 19:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 121401, 15, 0, 0, 0, 121401, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 7, 0, "ミサキ（ステージ）", "2030/12/31 15:00:00", 0, 0, 2, 121401, 7, 121401, 3, 2.27, 742, "みさき", "2022/03/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 121501, 12, 0, 0, 0, 121501, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 6, 0, "アユミ（怪盗）", "2024/04/15 14:59:59", 0, 0, 1, 121501, 6, 121501, 3, 2.0, 590, "あゆみ", "2024/04/12 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 121601, 17, 0, 0, 0, 121601, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 3, 0, "イノリ（怪盗）", "2030/12/31 15:00:00", 0, 0, 1, 121601, 3, 121601, 3, 1.425, 292, "いのり", "2022/04/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, 121701, 0, 180901, 1, 0, 121701, "", 0, 0, "アキノ（アキノ＆サレン）", "2030/12/31 15:00:00", 0, 0, 0, 0, 0, 0, 3, 0.0, 421, "あきの", "2015/04/01 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, 121801, 0, 180901, 1, 0, 121801, "", 0, 0, "サレン（アキノ＆サレン）", "2030/12/31 15:00:00", 0, 0, 0, 0, 0, 0, 3, 0.0, 421, "されん", "2015/04/01 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 121901, 12, 0, 0, 0, 121901, "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", 5, 0, "アンナ（パイレーツ）", "2030/12/31 15:00:00", 0, 0, 2, 121901, 5, 121901, 3, 2.125, 293, "あんな", "2022/05/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 122001, 14, 0, 0, 0, 122001, "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", 3, 0, "シノブ（パイレーツ）", "2030/12/31 15:00:00", 0, 0, 1, 122001, 3, 122001, 3, 1.425, 380, "しのぶ", "2022/05/03 19:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 122101, 9, 0, 0, 0, 122101, "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", 35, 0, "アオイ（キャンプ）", "2030/12/31 15:00:00", 0, 0, 1, 122101, 35, 122101, 1, 1.97, 731, "あおい", "2024/04/18 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 122201, 8, 0, 0, 0, 122201, "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", 4, 0, "ユカリ（キャンプ）", "2030/12/31 15:00:00", 0, 0, 1, 122201, 4, 122201, 3, 1.84, 419, "ゆかり", "2022/05/31 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 122301, 0, 0, 0, 0, 122301, "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", 43, 0, "ヴァンピィ", "2030/12/31 15:00:00", 0, 0, 2, 122301, 43, 122301, 3, 1.425, 564, "うぁんぴぃ", "2022/06/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 122401, 8, 0, 0, 0, 122401, "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", 1, 0, "ヒヨリ（サマー）", "2030/12/31 15:00:00", 0, 0, 1, 122401, 1, 122401, 1, 2.42, 264, "ひより", "2024/06/17 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 122501, 0, 0, 0, 0, 122501, "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", 4, 0, "レイ（サマー）", "2024/08/31 11:59:59", 0, 0, 1, 122501, 4, 122501, 3, 1.965, 250, "れい", "2024/08/26 19:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 122601, 0, 0, 0, 0, 122601, "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", 7, 0, "ユイ（サマー）", "2030/12/31 15:00:00", 0, 0, 2, 122601, 7, 122601, 3, 2.27, 554, "ゆい", "2022/07/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 122701, 0, 0, 0, 0, 122701, "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", 7, 0, "キョウカ（サマー）", "2030/12/31 15:00:00", 0, 0, 2, 122701, 7, 122701, 3, 1.92, 812, "きょうか", "2022/08/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 122801, 0, 0, 0, 0, 122801, "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", 1, 0, "ミソギ（サマー）", "2030/12/31 15:00:00", 0, 0, 1, 122801, 1, 122801, 1, 2.295, 237, "みそぎ", "2024/07/16 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 122901, 0, 0, 0, 0, 122901, "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", 5, 0, "ミミ（サマー）", "2024/08/31 11:59:59", 0, 0, 1, 122901, 5, 122901, 3, 2.25, 361, "みみ", "2024/08/26 19:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 123001, 0, 0, 0, 0, 123001, "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", 44, 0, "アメス", "2025/01/03 18:59:59", 0, 0, 2, 123001, 44, 123001, 3, 2.27, 746, "あめす", "2024/12/31 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 123101, 0, 0, 0, 0, 123101, "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", 7, 0, "マホ（エクスプローラー）", "2030/12/31 15:00:00", 0, 0, 2, 123101, 7, 123101, 3, 1.795, 793, "まほ", "2022/09/03 19:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 123201, 0, 0, 0, 0, 123201, "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", 3, 0, "アヤネ（エクスプローラー）", "2030/12/31 15:00:00", 0, 0, 1, 123201, 3, 123201, 3, 1.425, 256, "あやね", "2022/09/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 123301, 0, 0, 0, 0, 123301, "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", 1, 0, "ネア", "2024/09/30 11:59:59", 0, 0, 1, 123301, 0, 123301, 3, 1.62, 350, "ねあ", "2024/09/25 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, 123401, 0, 0, 0, 0, 123401, "", 5, 0, "ジュン（キャンプ）", "2030/12/31 15:00:00", 0, 0, 0, 0, 5, 0, 3, 0.0, 0, "じゅん", "2015/04/01 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 123501, 0, 0, 0, 0, 123501, "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", 6, 0, "リン（ハロウィン）", "2030/12/31 15:00:00", 0, 0, 1, 123501, 6, 123501, 1, 2.34, 583, "りん", "2024/09/17 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 123601, 0, 0, 0, 0, 123601, "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", 4, 0, "トモ（ハロウィン）", "2024/10/28 11:59:59", 0, 0, 1, 123601, 4, 123601, 3, 1.965, 262, "とも", "2024/10/24 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 123701, 0, 0, 0, 0, 123701, "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", 7, 0, "ナナカ（ハロウィン）", "2030/12/31 15:00:00", 0, 0, 2, 123701, 21, 123701, 3, 2.07, 741, "ななか", "2022/10/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 123801, 0, 0, 0, 0, 123801, "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", 1, 0, "クリスティーナ（ワイルド）", "2024/11/30 11:59:59", 0, 0, 1, 123801, 1, 123801, 3, 2.295, 238, "くりすてぃーな", "2024/11/26 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 123901, 0, 0, 0, 0, 123901, "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", 2, 0, "マツリ（ワイルド）", "2030/12/31 15:00:00", 0, 0, 1, 123901, 2, 123901, 3, 2.125, 183, "まつり", "2022/11/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 124001, 0, 0, 0, 0, 124001, "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", 7, 0, "アカリ（クリスマス）", "2024/12/31 11:59:59", 0, 0, 2, 124001, 7, 124001, 3, 2.07, 438, "あかり", "2024/12/22 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 124101, 0, 0, 0, 0, 124101, "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", 6, 0, "ヨリ（クリスマス）", "2030/12/31 15:00:00", 0, 0, 2, 124101, 6, 124101, 1, 1.965, 433, "より", "2024/11/16 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 124201, 0, 0, 0, 0, 124201, "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", 5, 0, "ジュン（クリスマス）", "2030/12/31 15:00:00", 0, 0, 1, 124201, 5, 124201, 3, 2.07, 144, "じゅん", "2022/12/23 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, 124301, 0, 181001, 1, 0, 124301, "", 0, 0, "アン（アン＆グレア）", "2030/12/31 15:00:00", 0, 0, 0, 0, 0, 0, 3, 0.0, 577, "あん", "2015/04/01 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, 124401, 0, 181001, 1, 0, 124401, "", 0, 0, "グレア（アン＆グレア）", "2030/12/31 15:00:00", 0, 0, 0, 0, 0, 0, 3, 0.0, 577, "ぐれあ", "2015/04/01 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 124501, 0, 0, 0, 0, 124501, "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", 7, 0, "ホマレ（ニューイヤー）", "2025/01/20 11:59:59", 0, 0, 2, 124501, 21, 124501, 3, 2.07, 707, "ほまれ", "2025/01/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 124601, 0, 0, 0, 0, 124601, "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", 7, 0, "ミサト（ニューイヤー）", "2025/01/20 11:59:59", 0, 0, 2, 124601, 21, 124601, 3, 2.44, 698, "みさと", "2025/01/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 124701, 0, 0, 0, 0, 124701, "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", 7, 0, "ミツキ（ニューイヤー）", "2030/12/31 15:00:00", 0, 0, 1, 124701, 46, 124701, 1, 2.24, 590, "みつき", "2024/12/16 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 124801, 0, 0, 0, 0, 124801, "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", 4, 0, "ノゾミ（リベレイター）", "2024/02/14 23:59:59", 0, 0, 1, 124801, 0, 124801, 3, 2.14, 423, "のぞみ", "2024/02/12 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 124901, 0, 0, 0, 0, 124901, "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", 1, 0, "カヤ（リベレイター）", "2030/12/31 15:00:00", 0, 0, 1, 124901, 0, 124901, 1, 1.965, 170, "かや", "2025/01/16 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 125001, 0, 0, 0, 0, 125001, "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", 5, 0, "ムイミ（リベレイター）", "2024/02/14 23:59:59", 0, 0, 1, 125001, 0, 125001, 3, 1.965, 221, "むいみ", "2024/02/12 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 125101, 0, 0, 0, 0, 125101, "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", 8, 0, "タマキ（カフェ）", "2030/12/31 15:00:00", 0, 0, 1, 125101, 47, 125101, 3, 2.24, 825, "たまき", "2023/03/03 19:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 125201, 0, 0, 0, 0, 125201, "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", 4, 0, "モニカ（カフェ）", "2030/12/31 15:00:00", 0, 0, 1, 125201, 4, 125201, 3, 1.965, 463, "もにか", "2023/03/10 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 125301, 0, 0, 0, 0, 125301, "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", 6, 0, "コッコロ（レンジャー）", "2024/04/15 14:59:59", 0, 0, 1, 125301, 6, 125301, 3, 2.07, 752, "こっころ", "2024/04/12 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 125401, 0, 0, 0, 0, 125401, "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", 8, 0, "シオリ（レンジャー）", "2030/12/31 15:00:00", 0, 0, 1, 125401, 8, 125401, 3, 2.09, 710, "しおり", "2023/04/10 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 125501, 0, 0, 0, 0, 125501, "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", 7, 0, "ジータ（ウォーロック）", "2024/05/15 14:59:59", 0, 0, 2, 125501, 50, 125501, 3, 1.92, 443, "じーた", "2024/05/10 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 125601, 0, 0, 0, 0, 125601, "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", 51, 0, "ビカラ", "2024/05/15 14:59:59", 0, 0, 1, 125601, 0, 125601, 3, 2.09, 267, "びから", "2024/05/10 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 125701, 0, 0, 1, 0, 125701, "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", 7, 0, "カリン（アルケミスト）", "2030/12/31 15:00:00", 0, 0, 2, 125701, 9, 125701, 1, 2.24, 579, "かりん", "2023/04/30 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 125801, 0, 0, 0, 0, 125801, "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", 3, 0, "リリ（フォールン）", "2030/12/31 15:00:00", 0, 0, 1, 125801, 0, 125801, 3, 2.09, 464, "りり", "2023/04/17 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, 125901, 0, 0, 0, 0, 125901, "", 1, 0, "カヤ（リベレイター）", "2030/12/31 15:00:00", 0, 0, 0, 0, 1, 0, 3, 0.0, 0, "かや", "2015/04/01 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 126001, 0, 0, 0, 0, 126001, "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", 0, 0, "クリア（フォールン）", "2030/12/31 15:00:00", 0, 0, 1, 126001, 0, 126001, 3, 2.09, 406, "くりあ", "2023/10/31 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 126101, 0, 0, 0, 0, 126101, "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", 44, 0, "プレシア（フォールン）", "2030/12/31 15:00:00", 0, 0, 2, 126101, 53, 126101, 3, 2.09, 480, "ぷれしあ", "2023/11/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 126201, 0, 0, 0, 0, 126201, "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", 3, 0, "イリヤ（儀装束）", "2024/06/15 14:59:59", 0, 0, 2, 126201, 3, 126201, 3, 2.09, 568, "いりや", "2024/06/10 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 126301, 0, 0, 0, 0, 126301, "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", 7, 0, "ユキ（儀装束）", "2030/12/31 15:00:00", 0, 0, 2, 126301, 9, 126301, 3, 2.07, 456, "ゆき", "2023/06/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 126401, 0, 0, 0, 0, 126401, "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", 1, 0, "クローチェ", "2025/01/03 18:59:59", 0, 0, 1, 126401, 1, 126401, 3, 2.09, 373, "くろーちぇ", "2024/12/31 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 126501, 0, 0, 0, 0, 126501, "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", 7, 0, "ライラエル", "2025/01/03 18:59:59", 0, 0, 2, 126501, 0, 126501, 3, 1.965, 740, "らいらえる", "2024/12/31 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 126601, 0, 0, 0, 0, 126601, "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", 7, 0, "ネネカ（サマー）", "2024/07/15 14:59:59", 0, 0, 2, 126601, 7, 126601, 3, 2.04, 650, "ねねか", "2024/07/11 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 126701, 0, 0, 1, 0, 126701, "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", 5, 0, "アキノ（サマー）", "2030/12/31 15:00:00", 0, 0, 1, 126701, 5, 126701, 1, 1.965, 224, "あきの", "2023/06/30 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 126801, 0, 0, 0, 0, 126801, "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", 5, 0, "ユカリ（サマー）", "2030/12/31 15:00:00", 0, 0, 1, 126801, 5, 126801, 3, 1.97, 159, "ゆかり", "2023/07/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 126901, 0, 0, 0, 0, 126901, "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", 7, 0, "ランファ（サマー）", "2024/08/12 11:59:59", 0, 0, 2, 126901, 21, 126901, 3, 1.965, 682, "らんふぁ", "2024/08/09 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 127001, 0, 0, 1, 0, 127001, "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", 2, 0, "クウカ（サマー）", "2023/08/14 20:59:59", 0, 0, 1, 127001, 52, 127001, 1, 1.97, 133, "くうか", "2023/07/31 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 127101, 0, 0, 0, 0, 127101, "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", 5, 0, "シノブ（サマー）", "2024/08/12 11:59:59", 0, 0, 1, 127101, 46, 127101, 3, 2.09, 255, "しのぶ", "2024/08/09 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 127201, 0, 0, 0, 0, 127201, "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", 7, 0, "キャル（編入生）", "2024/10/13 11:59:59", 0, 0, 2, 127201, 7, 127201, 3, 2.09, 804, "きゃる", "2024/10/10 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 127301, 0, 0, 0, 0, 127301, "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", 8, 0, "スズナ（編入生）", "2030/12/31 15:00:00", 0, 0, 1, 127301, 8, 127301, 3, 2.09, 750, "すずな", "2023/09/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, 127401, 0, 0, 0, 0, 127401, "", 1, 0, "ビカラ（コラボ）", "2030/12/31 15:00:00", 0, 0, 0, 0, 1, 0, 3, 0.0, 0, "びから", "2015/04/01 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 127501, 0, 0, 0, 0, 127501, "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", 4, 0, "サレン（サラサリア）", "2024/11/18 11:59:59", 0, 0, 1, 127501, 4, 127501, 3, 2.09, 304, "されん", "2024/11/11 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 127601, 0, 0, 0, 0, 127601, "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", 4, 0, "ルカ（サラサリア）", "2030/12/31 15:00:00", 0, 0, 1, 127601, 4, 127601, 3, 1.965, 157, "るか", "2023/10/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 127701, 0, 0, 0, 0, 127701, "【魔法】後衛で、メイド業に奔走する双子ドラゴンの姉。\nＵＢのフィールド展開中は攻撃、防御、ＴＰ回復と多彩な\n支援スキルの効果が再発動し味方を手厚くサポートする。", 6, 0, "リンド", "2030/12/31 15:00:00", 0, 0, 2, 127701, 48, 127701, 3, 1.965, 693, "りんど", "2024/10/10 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 127801, 0, 0, 0, 0, 127801, "【魔法】後衛で、文句を言いつつ働く双子ドラゴンの妹。\nダメージと魔法防御力ダウンを両立するスキルを持つが、\n目を離すと【サボりの誘惑】に負け、手を抜いてしまう。", 7, 0, "ヴルム", "2030/12/31 15:00:00", 0, 0, 2, 127801, 47, 127801, 3, 1.965, 706, "うるむ", "2024/10/18 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 127901, 0, 0, 0, 0, 127901, "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", 5, 0, "ペコリーヌ（クリスマス）", "2024/12/15 14:59:59", 0, 0, 2, 127901, 5, 127901, 3, 1.965, 372, "ぺこりーぬ", "2024/12/09 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 128001, 0, 0, 0, 0, 128001, "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", 35, 0, "クレジッタ（クリスマス）", "2030/12/31 15:00:00", 0, 0, 1, 128001, 35, 128001, 3, 2.09, 723, "くれじった", "2023/12/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, 128101, 0, 181101, 1, 0, 128101, "", 0, 0, "シズル（シズル&リノ）", "2030/12/31 15:00:00", 0, 0, 0, 0, 0, 0, 3, 0.0, 580, "しずる", "2015/04/01 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, 128201, 0, 181101, 1, 0, 128201, "", 0, 0, "リノ（シズル&リノ）", "2030/12/31 15:00:00", 0, 0, 0, 0, 0, 0, 3, 0.0, 580, "りの", "2015/04/01 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 128301, 0, 0, 1, 0, 128301, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 3, 0, "イノリ（ニューイヤー）", "2030/12/31 15:00:00", 0, 0, 1, 128301, 38, 128301, 1, 2.09, 191, "いのり", "2023/12/31 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 128401, 0, 0, 0, 0, 128401, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 7, 0, "ハツネ（ニューイヤー）", "2025/01/15 14:59:59", 0, 0, 2, 128401, 21, 128401, 3, 2.09, 801, "はつね", "2025/01/09 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 128501, 0, 0, 0, 0, 128501, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", 7, 0, "カスミ（ニューイヤー）", "2025/01/15 14:59:59", 0, 0, 2, 128501, 21, 128501, 3, 2.09, 739, "かすみ", "2025/01/09 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, 128601, 0, 0, 0, 0, 128601, "", 1, 0, "リリ（フォールン）", "2030/12/31 15:00:00", 0, 0, 0, 0, 1, 0, 3, 0.0, 0, "りり", "2015/04/01 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 128701, 0, 0, 0, 0, 128701, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", 1, 0, "ヒヨリ（アストラル）", "2025/02/15 14:59:59", 0, 0, 1, 128701, 0, 128701, 3, 2.09, 226, "ひより", "2025/02/10 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 128801, 0, 0, 1, 0, 128801, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", 4, 0, "レイ（アストラル）", "2030/12/31 15:00:00", 0, 0, 1, 128801, 0, 128801, 1, 1.965, 194, "れい", "2024/01/31 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 128901, 0, 0, 0, 0, 128901, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", 7, 0, "ユイ（アストラル）", "2025/02/15 14:59:59", 0, 0, 2, 128901, 0, 128901, 3, 2.09, 772, "ゆい", "2025/02/10 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 129001, 0, 0, 0, 0, 129001, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", 7, 0, "エリス", "2025/01/03 18:59:59", 0, 0, 2, 129001, 0, 129001, 3, 2.09, 800, "えりす", "2024/12/31 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 129301, 0, 0, 0, 0, 129301, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", 7, 0, "ユニ（ウィンター）", "2024/09/30 11:59:59", 0, 0, 1, 129301, 7, 129301, 3, 2.09, 708, "ゆに", "2024/09/25 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 129401, 0, 0, 0, 0, 129401, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", 2, 0, "クロエ（ウィンター）", "2030/12/31 15:00:00", 0, 0, 1, 129401, 2, 129401, 3, 2.09, 188, "くろえ", "2024/03/18 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 129501, 0, 0, 0, 0, 129501, "【物理】前衛で、ちぇるっとちぇるるな水着のちえるん。\nステータスアップで溜まる【ちぇる】を、自身の火力や\n支援能力に還元して、真冬の真夏をちぇらるれれぽぱぴ？", 1, 0, "チエル（ウィンター）", "2024/12/22 11:59:59", 0, 0, 1, 129501, 1, 129501, 3, 2.09, 247, "ちえる", "2024/12/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 129601, 0, 0, 0, 0, 129601, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", 0, 0, "アネモネ", "2025/01/03 18:59:59", 0, 0, 1, 129601, 0, 129601, 3, 2.09, 550, "あねもね", "2024/12/31 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 129701, 0, 0, 0, 0, 129701, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", 0, 0, "ネフィ＝ネラ", "2025/01/03 18:59:59", 0, 0, 1, 129701, 0, 129701, 3, 2.09, 540, "ねふぃーねら", "2024/12/31 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 129801, 0, 0, 0, 0, 129801, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", 5, 0, "マコト（コマンダー）", "2024/10/18 11:59:59", 0, 0, 1, 129801, 5, 129801, 3, 2.09, 269, "まこと", "2024/10/13 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 129901, 0, 0, 0, 0, 129901, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", 6, 0, "エリコ（コマンダー）", "2030/12/31 15:00:00", 0, 0, 1, 129901, 48, 129901, 3, 1.84, 294, "えりこ", "2024/04/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 130001, 0, 0, 0, 0, 130001, "【物理】前衛で、豪胆にスリルを嗜む盗賊ギルドの長女。\n最前線で命を張りながら、獲得した【バンディダイス】の\n消費によって自らを大幅強化し、有象無象を地に伏せる。", 4, 0, "ヤマト", "2024/11/18 11:59:59", 0, 0, 1, 130001, 0, 130001, 3, 2.09, 150, "やまと", "2024/11/11 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 130101, 0, 0, 0, 0, 130101, "【物理】中衛の、貧乏クジを引きがちな盗賊ギルド次女。\n召喚したスキッドがワカナをかばって前線に立ち、自身は\n攻撃支援にＨＰとＴＰ回復まで、献身的に味方を支える。", 7, 0, "ワカナ", "2024/11/26 11:59:59", 0, 0, 1, 130101, 9, 130101, 3, 2.09, 535, "わかな", "2024/11/18 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 130201, 0, 0, 0, 0, 130201, "【物理】中衛の、ナマイキで超天才な盗賊ギルドの三女。\n【味方バリアー♡】で自分へのダメージを味方に押し付け\nＨＰ最大でダメージアップする範囲攻撃で敵を蹂躙する。", 5, 0, "フブキ", "2024/11/11 11:59:59", 0, 0, 1, 130201, 0, 130201, 3, 1.84, 371, "ふぶき", "2024/10/31 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, 130601, 0, 0, 0, 0, 130601, "", 4, 0, "レイ（アストラル）", "2030/12/31 15:00:00", 0, 0, 0, 0, 1, 0, 3, 0.0, 0, "れい", "2015/04/01 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 130701, 0, 0, 0, 0, 130701, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", 7, 0, "キョウカ（スプリング）", "2024/11/18 11:59:59", 0, 0, 2, 130701, 7, 130701, 3, 1.92, 563, "きょうか", "2024/11/11 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 130801, 0, 0, 0, 0, 130801, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", 7, 0, "スズメ（スプリング）", "2030/12/31 15:00:00", 0, 0, 2, 130801, 7, 130801, 3, 1.84, 558, "すずめ", "2024/05/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 130901, 0, 0, 0, 0, 130901, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", 7, 0, "クルル", "2030/12/31 15:00:00", 0, 0, 2, 130901, 7, 130901, 3, 2.09, 440, "くるる", "2024/06/15 15:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 131001, 0, 0, 0, 0, 131001, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", 7, 0, "マホ（ドリームパーク）", "2024/12/15 14:59:59", 0, 0, 2, 131001, 7, 131001, 3, 1.84, 702, "まほ", "2024/12/09 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 450, 131101, 0, 0, 0, 0, 131101, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", 2, 0, "ネア（サマー）", "2030/12/31 15:00:00", 0, 0, 1, 131101, 52, 131101, 3, 2.09, 165, "ねあ", "2024/06/30 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 450, 131201, 0, 0, 0, 0, 131201, "【魔法】後衛で夏の盛りにイイコトをする溌溂水着少女★\n【PSI★ストーム】をチャージし、連続攻撃で敵を殲滅し\nて、継続ＴＰ回復やバリアで抜け目なく味方を支援する。", 35, 0, "ミソラ（サマー）", "2025/01/15 14:59:59", 0, 0, 2, 131201, 35, 131201, 3, 2.09, 753, "みそら", "2025/01/09 12:00:00");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, 131301, 0, 0, 1, 0, 131301, "", 1, 0, "リリ", "2030/12/31 15:00:00", 0, 0, 0, 0, 1, 0, 3, 0.0, 0, "りり", "2015/04/01 15:00:00");
